Marca y Modelo: BMW X1 sDrive16d

Equipamiento y características:
- Climatizador automático;  
- Faros LED con luces diurnas; 
- Sistema de navegación BMW Business;  
- Sensores de aparcamiento traseros (PDC);  
- Volante multifunción en cuero;  
- Llantas de aleación de 17 pulgadas;  
- Asientos delanteros con ajuste eléctrico;  
- Pantalla central de 6.5 pulgadas;  
- Espejos exteriores eléctricos y calefactables;  
- Sistema de acceso y arranque sin llave (Comfort Access);  
- Dirección asistida eléctrica (EPS);  
- Faros antiniebla LED;  
- Airbags frontales, laterales y de cortina;  
- Sistema de control de estabilidad (DSC); 
- Sistema de control de presión de neumáticos (RDC);  
- Control de crucero con función de frenado;  
- Anclajes ISOFIX para asientos infantiles;  
- Cierre centralizado con mando a distancia;  
- Elevalunas eléctricos delanteros y traseros;  
- Función Start/Stop automático;  
- Revestimientos interiores en tela 'Grid' Anthrazit.

Precio final SIN OBLIGACIÓN de financiación: El precio incluye todos los impuestos, el cambio de nombre, 12 meses de garantía y la preentrega.

Todos nuestros vehículos pasan un estricto control de calidad según los estándares de nuestros talleres.

¿No eres de Gerona? No te preocupes, te llevamos el coche a tu domicilio (consultar condiciones).

Aceptamos todo tipo de vehículos como parte de pago. Llámanos y tasamos tu coche sin compromiso.

Financiación: Contamos con las mejores condiciones de financiación del mercado.

Llámanos y te haremos una propuesta personalizada que se adapte a tus necesidades.

BRANDAUTO S.L. es una empresa con años de experiencia ofreciendo el mejor servicio al cliente y a tu vehículo. Si no encuentras el vehículo de ocasión que estás buscando, consúltanos y lo encontramos para ti. Tenemos experiencia en importación y exportación de vehículos.

Horario de atención: 
De lunes a viernes: 9:00h - 13:30h y 15:00h - 20:00h.
Sábados: 10:00h - 14:00h.

Ubicación: Visítanos en nuestras instalaciones en Ctra N II km 710, Fornells de la Selva, Zona Concesionarios.

Ven a probar el BMW X1 sDrive16d y descubre por qué es la mejor opción para ti. ¡Te esperamos en BRANDAUTO S.L.!

